const Status = {
  READ: "Read",
  NOT_READ: "Not Read",
  IN_PROGRESS: "In Progress"
};


const library = [ new Book(
    '1',
    'J.K. Rowling',
    'Harry Potter and the Sorcerer\'s Stone',
    309,
    Status.READ,
    'data:image/jpeg;base64,'
  ),
  new Book (
    '2',
    'J.R.R. Tolkien',
    'The Hobbit',
    310,
    Status.IN_PROGRESS,
    'data:image/jpeg;base64,'
  ),
  new Book(
    '3',
    'George Orwell',
    '1984',
    328,
    Status.NOT_READ,
    'data:image/png;base64,'
  ),
  new Book (
    '4',
    'Harper Lee',
    'To Kill a Mockingbird',
    281,
    Status.READ,
    'data:image/jpeg;base64,'
  )
];

function Book(
  id, author, title, pages, status, image
) {
  this.id = id;
  this.author = author;
  this.title = title;
  this.pages = pages;
  this.status = status;
  this.image = image;
}

Book.prototype.changeStatus = function (selectedStatus) {
  this.status = selectedStatus;
}

const table = document.querySelector('.container');


async function addBookToLibrary(
  title, author, pages, status, image
) {
  // take params, create books, and then store
  // create: need an id for each book crypto.randomUUID()
  const id = crypto.randomUUID();
  // convert the image to Base64
  let base64Image = '';
  if(image) {
    base64Image = await toBase64(image);
  } else {
    base64Image = 'data:image/png;base64,'
  }

  const newBook = new Book(
    id,
    author,
    title,
    pages,
    status,
    base64Image
  );
  library.push(newBook);
  const card = createCard(newBook);
  table.appendChild(card);
}


function displayLibrary() {
  library.forEach(book => {
    const card = createCard(book);

    table.appendChild(card); //  by gi appendChild nhn Node
  });
}

displayLibrary();


function toBase64(file) {
  return new Promise((resolve, reject) => {
    const reader = new FileReader();

    reader.onload = () => resolve(reader.result);
    reader.onerror = (error) => reject(error);

    reader.readAsDataURL(file);
  })
}

function createCard(book) {
  const card = document.createElement('div'); //  div thay cho <card>
  card.className = 'card';
  card.dataset.id = book.id;

  card.innerHTML = `
      <div class="infor">
        <h3 class="title">Title: ${book.title}</h3>
        <p class="author">Author: ${book.author}</p>
        <p class="pages">Pages: ${book.pages}</p>
        <p>
          <button class="read ${book.status === Status.READ ? "active" : ""}">Read</button>
          <button class="not-read  ${book.status === Status.NOT_READ ? "active" : ""}">Not Read</button>
          <button class="in-progress  ${book.status === Status.IN_PROGRESS ? "active" : ""}">In Progress</button>
        </p> 
      </div>
      <div class="image">
        <img src="${book.image}" alt="book-image">
      </div>
      <i class="delete-button fa-solid fa-trash"></i>
    `;


  const deleteButtons = card.querySelector('.delete-button');
  deleteButtons.addEventListener('click', (e) => {
    e.stopPropagation();   // prevent triggering card click
    const bookId = card.dataset.id;

    const bookIndex = library.findIndex(book => book.id === bookId);
    if (bookIndex !== -1) {
      library.splice(bookIndex, 1);
    }
    card.remove();
  });

  const statusButtons = card.querySelectorAll('.infor button');
  statusButtons.forEach(button => {
    button.addEventListener('click', (e) => {
      e.stopPropagation();   // prevent triggering card click

      const selectedStatus = button.className.split(' ')[0].replace('-', ' ').replace(/\b\w/g, c => c.toUpperCase());

      // Update book status in library
      const bookId = card.dataset.id;
      const book = library.find(book => book.id === bookId);
      if (book) {
        book.changeStatus(selectedStatus);
      }

      // Update button styles
      statusButtons.forEach(btn => btn.classList.remove('active'));
      button.classList.add('active');
    })
  });
  return card;
}

const addButton = document.querySelector(".add-button");
const formDialog = document.querySelector(".favDialog");

if (addButton) {
  addButton.addEventListener("click", () => {
    formDialog.showModal();
  });
}

if (formDialog) {
  const titleInput = formDialog.querySelector(".title-input");
  const authorInput = formDialog.querySelector(".author-input");
  const pagesInput = formDialog.querySelector(".pages-input");
  const statusInput = formDialog.querySelector(".status-input");
  const imageInput = formDialog.querySelector(".image-input");

  const cancelButton = formDialog.querySelector(".cancel-button");
  const createButton = formDialog.querySelector(".create-button");
  cancelButton.addEventListener("click", (e) => {
    e.preventDefault();
    formDialog.close("cancel");
  });
  createButton.addEventListener("click", (e) => {
    e.preventDefault();

    // check validity Before closing
    const form = formDialog.querySelector("form");
    if (!form.checkValidity()) {
      form.reportValidity();
      return;
    }

    formDialog.close("create");
  });



  formDialog.addEventListener("close", async (e) => {
    console.log("Dialog closed with returnValue:", formDialog.returnValue);
    if (formDialog.returnValue === "create") {
      try {
        await addBookToLibrary(
          titleInput.value,
          authorInput.value,
          parseInt(pagesInput.value),
          statusInput.value,
          imageInput.files[0]
        );
        alert("Book added successfully!");
        console.log(library);
      } catch (error) {
        console.error("Error adding book to library:", error);
        alert("Failed to add book. Please check the input values.");
      }

      formDialog.querySelector("form").reset();
    } else {
      console.log("Form cancelled");
    }
  })
}
